    [TestClass]
    public class TagRepositoryTests : BaseRepositoryTests
    {
        [TestMethod, TestCategory("RepositoryTests")]
        public void Should_Create_Tag()
        {
            var tag = new Tag
            {
                Name = "Tag1",
                Count = 1234,
                Description = "Desc",
                Hint = "Hint",
                Status = TagStatus.Active
            };

            using (var db = Db.ReadWrite())
            {
                var repo = db.GetRepository<ITagRepository>();
                repo.Save(tag);
                db.Save();
            }

            Tag tag2;

            using (var db = Db.Readonly())
            {
                var repo = db.GetRepository<ITagRepository>();
                tag2 = repo.GetAll().FirstOrDefault(t => t.Id == tag.Id);
            }

            Assert.IsNotNull(tag2);

            Assert.AreEqual(tag.Count, tag2.Count);
            Assert.AreEqual(tag.Description, tag2.Description);
            Assert.AreEqual(tag.Hint, tag2.Hint);
            Assert.AreEqual(tag.Id, tag2.Id);
            Assert.AreEqual(tag.Name, tag2.Name);
            Assert.AreEqual(tag.Status, tag2.Status);
        }

        [TestMethod, TestCategory("RepositoryTests")]
        public void Should_Update_Tag()
        {
            var tag = new Tag
            {
                Name = "Tag1",
                Count = 1234,
                Description = "Desc",
                Hint = "Hint",
                Status = TagStatus.Active
            };

            using (var db = Db.ReadWrite())
            {
                var repo = db.GetRepository<ITagRepository>();
                repo.Save(tag);
                db.Save();
            }

            var tag2 = new Tag
            {
                Id = tag.Id,
                Count = tag.Count + 1,
                Description = tag.Description + " Updated",
                Hint = tag.Hint + " Updated",
                Name = tag.Name + " Updated",
                Status = TagStatus.Passive
            };

            using (var db = Db.ReadWrite())
            {
                var repo = db.GetRepository<ITagRepository>();
                repo.Save(tag2);
                db.Save();
            }

            using (var db = Db.Readonly())
            {
                var repo = db.GetRepository<ITagRepository>();
                tag2 = repo.GetAll().FirstOrDefault(t => t.Id == tag.Id);
            }

            Assert.IsNotNull(tag2);

            Assert.AreEqual(tag.Count + 1, tag2.Count);
            Assert.AreEqual(tag.Description + " Updated", tag2.Description);
            Assert.AreEqual(tag.Hint + " Updated", tag2.Hint);
            Assert.AreEqual(tag.Id, tag2.Id);
            Assert.AreEqual(tag.Name + " Updated", tag2.Name);
            Assert.AreEqual(TagStatus.Passive, tag2.Status);
        }

        [TestMethod, TestCategory("RepositoryTests")]
        public void Should_Search_Tags()
        {
            //var lines = File.ReadAllLines(@"C:\Users\mehmet\Downloads\tags.csv");
            //var sb = new StringBuilder();
            //for (var i = 1; i < lines.Length; i++)
            //{
            //    var ss = lines[i].Split(',');
            //    var tag = ss[1].Trim('"');
            //    var count = ss[2].Trim('"');

            //    sb.AppendFormat("{0}:{1}|", tag, count);
            //}
            var ss = Tags.Split('|');

            using (var db = Db.ReadWrite())
            {
                var repo = db.GetRepository<ITagRepository>();

                foreach (var s in ss)
                {
                    var rr = s.Split(':');
                    var tag = rr[0];
                    var count = Convert.ToInt32(rr[1]);

                    repo.Save(new Tag
                    {
                        Name = tag,
                        Count = count,
                        Description = tag + " Description",
                        Hint = tag + " Hint",
                        Status = TagStatus.Active
                    });    
                }
                
                db.Save();
            }

            IPage<Tag> page;
            using (var db = Db.Readonly())
            {
                var repo = db.GetRepository<ITagRepository>();
                page = repo.Search("ca", 1, 10);
            }

            Assert.AreEqual(10, page.Items.Length);

            var lastCount = Int64.MaxValue;
            foreach (var tag in page.Items)
            {
                Assert.IsTrue(lastCount >= tag.Count);
                Assert.IsTrue(tag.Name.Contains("ca"));
                lastCount = tag.Count;
            }
        }

